import React,{ Component } from 'react';
import Logged from './components/Model';
import axios from "axios"

export default class Home extends Component {

  getData=()=>{
    axios.get('main/')
    .then(data=>{
      let newState={...this.props.that}
      data.data.datum.forEach((item)=>{
        newState.id.push(item._id)
        newState.title.push(item.title)
        newState.train_score.push(item.train_acc)
        newState.test_score.push(item.test_acc)
        newState.url.push('http://placehold.it/300x300')
      })

      this.props.that.setState(newState)
    })
  }

  componentDidMount(){
    this.getData()
  }
  render() {
    const info=this.props.that.title.map((item,index)=>{
      return <Logged url={this.props.that.url[index]} title={this.props.that.title[index]} train_score={this.props.tha.train_score[index]} test_score={this.props.that.state.test_score[index]} key={index} id={this.props.that.state.id[index]} />
    })
    return (
      <div>
        {info}
        <div className='col-12 col-sm-6 col-md-4 card_model'>
        <div className="card border-success mb-5">
        <h4 className="card-header text-center">Add New</h4>
        </div>
        </div>
      </div>
    )
  }
}
